// Process Hotels - directly from array
let hotels = [];
for (const item of $('HTTP Request Hotels').all()) {
  const data = item.json;

  // If it's an array of hotels directly
  if (Array.isArray(data)) {
    hotels = data.slice(0, 5).map(h => ({
      name: h.name || 'Unknown Hotel',
      rating: h.rating || 'N/A',
      price: h.price ? `$${Math.round(h.price)}` : 'N/A',
      location: h.address?.full || h.location || 'N/A',
      url: h.url || null,
      stars: h.stars || null,
      reviews: h.reviews || null
    }));
  }
  // If it's a single hotel object with these fields
  else if (data.name && data.url) {
    hotels.push({
      name: data.name,
      rating: data.rating || 'N/A',
      price: data.price ? `$${Math.round(data.price)}` : 'N/A',
      location: data.address?.full || 'N/A',
      url: data.url,
      stars: data.stars || null,
      reviews: data.reviews || null
    });
  }
}

// Limit to top 5 hotels, sorted by rating
if (hotels.length > 5) {
  hotels = hotels.sort((a, b) => (b.rating || 0) - (a.rating || 0)).slice(0, 5);
}

// Process Flights
let flights = [];
for (const item of $('HTTP Request Flights').all()) {
  const data = item.json;

  // Handle array response
  if (Array.isArray(data)) {
    for (const flightData of data) {
      if (flightData.best_flights) {
        flights = flights.concat(flightData.best_flights.map(f => ({
          airline: f.flights?.[0]?.airline || 'Unknown',
          flightNumber: f.flights?.[0]?.flight_number || '',
          price: flightData.price_insights?.lowest_price || f.price || 'N/A',
          duration: f.total_duration || 'N/A',
          stops: (f.flights?.length || 1) - 1,
          departure: f.flights?.[0]?.departure_airport?.time || 'N/A',
          arrival: f.flights?.[f.flights?.length - 1]?.arrival_airport?.time || 'N/A',
          departureAirport: f.flights?.[0]?.departure_airport?.id || '',
          arrivalAirport: f.flights?.[f.flights?.length - 1]?.arrival_airport?.id || '',
          airplane: f.flights?.[0]?.airplane || '',
          // No direct booking URL from Google Flights API
        })));
      }
      if (flightData.other_flights) {
        flights = flights.concat(flightData.other_flights.slice(0, 2).map(f => ({
          airline: f.flights?.[0]?.airline || 'Unknown',
          flightNumber: f.flights?.[0]?.flight_number || '',
          price: f.price || 'N/A',
          duration: f.total_duration || 'N/A',
