          arrivalAirport: f.flights?.[f.flights?.length - 1]?.arrival_airport?.id || '',
          airplane: f.flights?.[0]?.airplane || '',
        })));
      }
    }
  }
  // Handle single object response
  else if (data.best_flights) {
    flights = flights.concat(data.best_flights.map(f => ({
      airline: f.flights?.[0]?.airline || 'Unknown',
      flightNumber: f.flights?.[0]?.flight_number || '',
      price: data.price_insights?.lowest_price || f.price || 'N/A',
      duration: f.total_duration || 'N/A',
      stops: (f.flights?.length || 1) - 1,
      departure: f.flights?.[0]?.departure_airport?.time || 'N/A',
      arrival: f.flights?.[f.flights?.length - 1]?.arrival_airport?.time || 'N/A',
      departureAirport: f.flights?.[0]?.departure_airport?.id || '',
      arrivalAirport: f.flights?.[f.flights?.length - 1]?.arrival_airport?.id || '',
      airplane: f.flights?.[0]?.airplane || '',
    })));
  }
}

// Limit flights to top 5
flights = flights.slice(0, 5);

